import{_ as e,o as a,c as o,O as t}from"./chunks/framework.9482e208.js";const g=JSON.parse('{"title":"§ 33.2-414 Application to county roads.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/33.2-414.md","filePath":"vacode/33.2-414.md"}'),r={name:"vacode/33.2-414.md"},n=t('<h1 id="§-33-2-414-application-to-county-roads" tabindex="-1">§ 33.2-414 Application to county roads. <a class="header-anchor" href="#§-33-2-414-application-to-county-roads" aria-label="Permalink to &quot;§ 33.2-414 Application to county roads.&quot;">​</a></h1><p>Sections <a href="http://law.lis.virginia.gov/vacode/33.2-409/" target="_blank" rel="noreferrer">33.2-409</a> through <a href="http://law.lis.virginia.gov/vacode/33.2-413/" target="_blank" rel="noreferrer">33.2-413</a> shall also apply to dams, over which pass public roads that are not in the primary or secondary state highway system, and to the owners and occupiers thereof. As to any such dam and the owner or occupier thereof, the powers conferred and imposed upon the Commissioner of Highways in §§ <a href="http://law.lis.virginia.gov/vacode/33.2-409/" target="_blank" rel="noreferrer">33.2-409</a> through <a href="http://law.lis.virginia.gov/vacode/33.2-413/" target="_blank" rel="noreferrer">33.2-413</a> shall be vested in and imposed upon the governing body of the county in which such dam is located.</p><p>Code 1950, § 33-95; 1970, c. 322, § 33.1-181; 2014, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?141+ful+CHAP0805" target="_blank" rel="noreferrer">805</a>.</p>',3),i=[n];function s(c,l,h,d,p,_){return a(),o("div",null,i)}const u=e(r,[["render",s]]);export{g as __pageData,u as default};
